import Link from 'next/link'

const Index = () => (
    <div>
        <ul>
            <li><Link href = "/"><a>Home</a> </Link></li>
            <li><Link href = "/"><a>About</a> </Link></li>
        </ul>
        <h1>
            Welcome to Bitz Prises.
        </h1>
    </div>
);

export default Index;
